    var jest = true
    const signIn = async () =>{
            const response1234 = await catalog()
            jest = response1234
            console.log(jest)
    }
    return(
        <div>
            Catalog
            <Button onClick={signIn}>Нажми</Button>
            {jest ?
                <div>Авторизован</div>
                :
                <div>Не авторизован</div>
            }
        </div>
    );
})

export default Catalog;
